        }

        @media(max-width:580.98px) {
            flex: 1 1 100%;
        }

    }

    &__info {
        font-family: "Montserrat-Light";
        line-height: 160%;
        font-size: 1rem;
        @include mb(0.75rem);

        @media(max-width:1280.98px) {
            line-height: 120%;
            font-size: 0.8rem;
        }
        @media(max-width:768.98px) {
            @include mb(0.5rem);
        }
        @media(max-width:425.98px) {
            line-height: 120%;
            font-size: 4vw;
        }

        &-bold {
            font-family: "Montserrat-SemiBold";
            font-size: 1.75rem;

            @media(max-width:1280.98px) {
                font-size: 1.2rem;
            }

            @media(max-width:991.98px) {
                font-size: 0.8rem;
            }

            @media(max-width:425.98px) {
                font-size: 4vw;
            }
        }

        &-minibold {
            font-family: "Montserrat-SemiBold";
            font-size: 1rem;

            @media(max-width:1280.98px) {
                font-size: 0.8rem;
            }
        }
    }

    &__bottom {
        &-wrapper {
            display: flex;
            align-items: center;
            justify-content: space-between;

            @media(max-width:550.98px) {
                flex-flow: column;
            }

        }

        &-comandtitle {
            font-family: "Montserrat-SemiBold";
            font-size: 2.5rem;
            line-height: 160%;
            color: $primary;
            margin-bottom: 2.5rem;

            @media(max-width:1280.98px) {
                font-size: 2rem;
                line-height: 140%;
            }

            @media(max-width:991.98px) {
                font-size: 1.5rem;
                line-height: 140%;
                margin-bottom: 1.5rem;
            }

            @media(max-width:940.98px) {
                margin-bottom: 1rem;
                font-size: 1.2rem;
            }
        }

        &-comandsvg {
            @media(max-width:991.98px) {
                width: 150px;
                height: 150px;
            }

            @media(max-width:940.98px) {
                width: 100px;
                height: 100px;
            }

            @media(max-width:550.98px) {
                width: 150px;
                height: 150px;
            }
        }

        &-block {
            max-width: 487px;

            @media(max-width:1440.98px) {
                width: 30vw;
                height: 35vw;
            }

            @media(max-width:940.98px) {
                width: 25vw;
                height: 33vw;
            }

            @media(max-width:768.98px) {
                width: 30vw;
                height: 40vw;
            }

            @media(max-width:550.98px) {
                width: 60vw;
                height: 70vw;
            }

            @media(max-width:425.98px) {
                // width: 65vw;
                // height: 80vw;
                width: 80vw;
                height: 90vw;
            }
        }

        &-comand {
            display: flex;
            flex-direction: column;
            align-items: center;

            @media(max-width:550.98px) {
                width: 100%;
                margin: 1.5rem 0 2.3rem 0;
            }

            @media(max-width:370.98px) {
                width: 100%;
                margin: 2rem 0 2.3rem 0;
            }
        }

        &-name {
            font-family: "Montserrat-Medium";
            font-size: 1.25rem;
            line-height: 160%;

            @media(max-width:991.98px) {
                font-size: 1rem;
            }
        }

        &-job {
            color: $gray;
            font-family: "Montserrat-Light";
            font-size: 1rem;
            line-height: 140%;

            @media(max-width:991.98px) {
                font-size: 0.8rem;
            }
        }
    }
}

